Hello Pixies🧚‍♀ N Daisies🌼!!!

Here is the video for neutral makeup look. You can avoid concealer too if you don't have blemishes. The key here is to cover the blemishes only. Also you can avoid loose powder if you don't have oily skin like me. Feel free to experiment with the makeup😁.

